ControlPropertyState.AutoRuleBindingString:
Patch(
    RMAS,
    LookUp(// registro que ser atualizado
        RMAS,
        RMA = RMAId// condio pra achar o RMA certo
    ),
    {
        Projeto: LookUp(
            Projetos As P,
            P.Projeto = Self.Selected.Projeto
        )// ou Self.Selected se estiver no prprio ComboBox
    }
)

Patch(
    RMAS,
    LookUp(// registro que ser atualizado
        RMAS,
        RMA = RMAId// condio pra achar o RMA certo
    ),
    {
        'Ordem de Servio': LookUp(
            'Ordens de Servio Field Control' As OS,
            OS.'Ordem de Servio Field Control' = Self.Selected.'Ordem de Servio Field Control'
        )// ou Self.Selected se estiver no prprio ComboBox
    }
);
ClearCollect(
    OSSelecionada,
    If(
        !IsBlank(RMASelecionado.'Ordem de Servio'),
        LookUp(
            'Ordens de Servio Field Control' As OS,
            OS.'Ordem de Servio Field Control' = RMASelecionado.'Ordem de Servio'.'Ordem de Servio Field Control'
        )
    )
)
